import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    homePage: {
      main: '#613DC1',
    },
    gymFinderPage: {
      main: '#613DC1',
    },
    workoutPage: {
      main: '#613DC1',
    },
    mealPage: {
      main: '#613DC1',
    },
    supplementPage: {
      main: '#613DC1',
    },
    homePage: {
      main: '#613DC1',
    }
  }
});

export default theme;
